import React from "react";

function Boton({ texto, onClick, type = "button" }) {
  return (
    <div className="col-12 text-end mb-3">
      <button type={type} onClick={onClick} className="btn btn-primary">
        {texto}
      </button>
    </div>
  );
}

export default Boton;
